import React, { Component } from 'react';
import { StyleSheet, Text, View, TouchableOpacity, TextInput} from 'react-native';
import { Switch } from 'react-native';


export default class App extends Component {

   constructor(props){
    super(props);
    this.state = {
      nome: '',
      sobrenome: '',
      endereco: '',
      email: '',
      telefone: '',
      senha: '',
      confirmsenha: '',
      zona: 'false',
      internet: 'false',
    };
    this.enviarDados = this.enviarDados.bind(this);
   }

enviarDados() {
  if(this.state.nome == '' || this.state.idade == '')
  {
    alert('Preencha todos os campos corretamente')
    return
  }
  alert(
    'Conta cadastrada com sucesso!! /n / n' +
    'Nome:' + this.state.nome + '/n' +
    'Sobrenome:' + this.state.sobrenome + '/n' +
    'Endereço:' + this.state.endereco + '/n' +
    'Email:' + this.state.email + '/n' +
    'Telefone:' + this.state.telefone + '/n' +
    'Senha:' + this.state.senha + '/n' +
    'Confirmação da senha:' + this.state.confirmsenha + '/n' +
    'Mora em zona de risco:' + ((this.state.zona) ? 'Ativo' : 'Inativo') + '/n' +
    'Possui internet:' + ((this.state.internet) ? 'Ativo' : 'Inativo')
  )
}

  render(){
    return(
      < View style={styles.container}>
        <Text style={styles.bancoLogogroup}>TEC's DEVELOPERS</Text>
        <Text style={styles.bancoLogo}>ALERT ZONE's</Text>
          <View style={styles.forms}>
          <Text style={styles.textoNome}>Nome:</Text>
              <TextInput style={styles.input} placeholder="Digiter seu Nome aqui" underlineColorAndroid="transparent" onChangeText={ (texto) => this.setState({nome: texto})}></TextInput>

            <Text style={styles.textoNome}>Sobrenome:</Text>
              <TextInput style={styles.input} placeholder="Digiter seu Sobrenome aqui" underlineColorAndroid="transparent" onChangeText={ (texto) => this.setState({sobrenome: texto})}></TextInput>

              <Text style={styles.textoNome}>Endereço:</Text>
              <TextInput style={styles.input} placeholder="Digiter seu Endereço aqui" underlineColorAndroid="transparent" onChangeText={ (texto) => this.setState({endereco: texto})}></TextInput>

              <Text style={styles.textoNome}>Email:</Text>
              <TextInput style={styles.input} placeholder="Digiter seu Email aqui" underlineColorAndroid="transparent" onChangeText={ (texto) => this.setState({email: texto})}></TextInput>

              <Text style={styles.textoNome}>Telefone:</Text>
              <TextInput style={styles.input} placeholder="Digiter seu Telefone aqui" keyboarType="numeric" underlineColorAndroid="transparent" onChangeText={ (texto) => this.setState({telefone: texto})}></TextInput>

              <Text style={styles.textoNome}>Senha:</Text>
              <TextInput style={styles.input} placeholder="Digite sua Senha aqui" underlineColorAndroid="transparent" onChangeText={ (texto) => this.setState({senha: texto})}></TextInput>

              <Text style={styles.textoNome}>Confirmar Senha:</Text>
              <TextInput style={styles.input} placeholder="Confirme sua senha" underlineColorAndroid="transparent" onChangeText={ (texto) => this.setState({confirmsenha: texto})}></TextInput>            

               <View style={styles.areaZona}>
                  <Text style={styles.textoNome}>Mora proximo a zona de risco?</Text>
                  <Switch style={{paddingTop:15}} value={this.state.zona} onValueChange={(valorZona) => this.setState({zona: valorZona})}></Switch>
               </View>

               <View style={styles.areaZona}>
                  <Text style={styles.textoNome}>Possui internet em casa?</Text>
                  <Switch style={{paddingTop:15}} value={this.state.internet} onValueChange={(valorInternet) => this.setState({internet: valorInternet})}></Switch>
               </View>

               <View>
                 <TouchableOpacity style={styles.botao} onPress={this.enviarDados}>
                   <Text style={styles.botaoTexto}>Cadastrar Conta</Text>
                 </TouchableOpacity>
               </View>
            </View>
          </View>

      );
    }
  }
  const styles = StyleSheet.create({
    container:{
      flex: 1,
      paddingTop: 20,

    },
    areaformulario:{
      flexDirection: 'column',
      margin: 10,
    },
    textoNome:{
    fontSize: 17,
    color: '#000000',
    fontWeight:'bold'
    },
    botao:{
      height: 40,
      width: 300,
      justifyContent: 'center',
      alignItems: 'center',
      backgroundColor: '#000000',
      borderRadius: 150,
      margin: 20
    },
    areaZona:{
      flexDirection: 'column',
      alignItems: 'center'
    },
     botaoTexto:{
       fontSize: 20,
       fontWeight: 'bold',
       color: '#FFFFFF'
     },
     bancoLogogroup:{
       textAlign: 'center',
       fontSize: 17,
       fontWeight: 'bold',
       position: 'absolute', 
       right: 10,
       marginTop: 1170,
     },
     bancoLogo:{
      textAlign: 'center',
      fontSize: 65,
      fontWeight: 'bold',
      position: 'absolute', 
      right: 100,
      top: -300,
      marginTop: 400,
    },
    forms:{
     top: 300,
     left:70,
    },
    input:{
      placeholdercolor: '#DCDCDC',
      borderRadius: 5,
      margin: 8,
      padding: 8,
      color: '#000',
      fontSize:13
    },
  });
